import React from 'react';
import ReactDOM from 'react-dom';
import AppContainer from './common/containers/App';
import './styles/_main.scss';
import Routes from './routes';

ReactDOM.render(
  <div class='dark-mode'>
    <AppContainer>
      <Routes />
    </AppContainer>,
    document.getElementById('root')
  </div>
);
